INSERT INTO `omeka_search_texts` VALUES (1,'Collection',1,1,'Ancient Greece Collection','Ancient Greece Collection subj1 The Ancient Greece Collection has objects ranging in date from the beginning of pre-history to early Christianity in the Byzantine era. creator1 '),(2,'Item',1,1,'some Egyptian thing','some Egyptian thing s1 d1 c1 s1 p1 d1 c1 r1 rl1 f1 l1 t1 id1 c1 f1 d1 '),(3,'SimplePagesPage',1,1,'About MAC','About MAC <p>This Museum is an Ancient History/ Archaeology museum designed to support the teaching of undergraduate and postgraduate programs on offer at Macquarie University within the department of Ancient History. It also promotes Ancient History and Archaeology to the primary and secondary schools of NSW and the ACT as well as to the broader general community.</p>\r\n<p>The Museum of Ancient Cultures (MAC) was conceived to show elements of everyday life in the ancient world as the guiding principle to its on-going development. In this way modern minds can contemplate the lives and thoughts of past people and come to appreciate the work they have done before us.</p>\r\n<p>This site is designed to show information about activities and events associated with the Museum, about artefacts (and new additions) to our collections as well as about the collections themselves, about the programs we offer and the resources we have developed, including teaching resources. There are also links to organisations and museums associated with us.</p>\r\n<p>Through periodic updating, this site will also share our news with users. We hope you will enjoy the site and be in touch with us when you have suggestions or wish to make enquiries.</p>\r\n<p>[featured_collections num=1]</p>\r\n<p>[items num=1 sort=random]</p>\r\n<p>[featured_exhibits num=1]</p>\r\n<p>[carousel tags=carousel autoscroll=true showtitles=true]</p> '),(4,'Exhibit',1,1,'Egypt & Greece Exhibit','Egypt & Greece Exhibit  '),(5,'ExhibitPage',1,1,'e1page1','<p>A view of the pyramids at Giza from the plateau to the south of the complex. From left to right, the three largest are: the Pyramid of Menkaure, the Pyramid of Khafre and the Great Pyramid of Khufu. The three smaller pyramids in the foreground are subsidiary structures associated with Menkaure\'s pyramid.</p> <p>Pyramids at Giza</p> e1page1 '),(6,'SimplePagesPage',2,1,'Education','Education Education offerings include:\r\n- AHIS111\r\n- AHIS222\r\n- AHIS333\r\n- schools\r\n '),(7,'SimplePagesPage',3,1,'Programs','Programs Programs:\r\n- Education\r\n- Volunteers '),(8,'SimplePagesPage',4,1,'Contact Us','Contact Us <h2>Location</h2>\r\n<p><img src=\"http://www.mac.mq.edu.au/custom/files/media/mac-map_v2_thumbnail.jpg\" alt=\"MAC - Map Thumbnail\" /></p>\r\n<p>Building X5B Level 3<br />Ph: (02) 9850 9263<br />FX: (02) 9850 9267<br />E-mail:&nbsp;<a href=\"mailto:karl.vandyke@mq.edu.au\">karl.vandyke@mq.edu.au</a></p>\r\n<h2>Opening Hours</h2>\r\n<p>9.30am - 4.30pm Monday - Friday</p>\r\n<p>Other times by special arrangement</p> '),(26,'ExhibitPage',3,1,'Egyptian Exhibit','     Egyptian Exhibit '),(9,'SimplePagesPage',5,1,'Your visit','Your visit <h2>Opening Hours</h2>\r\n<p>9.30am - 4.30pm Monday - Friday (Other times by special arrangement)</p>\r\n<p>Please note that the Museum is usually open for major University events such as Information and Open Days, as well as major Ancient History events such as the annual Ancient History Teachers\' Conference and student Study Days.</p>\r\n<h2>Map</h2>\r\n<p><img src=\"http://www.mac.mq.edu.au/custom/files/media/mac-map_v2_thumbnail.jpg\" alt=\"MAC - Map Thumbnail\" /><a href=\"http://www.mac.mq.edu.au/custom/files/media/mac-map_v2.jpg\" target=\"_blank\"><br />View the full map</a></p>\r\n<h2>Transportation</h2>\r\n<p>Visit Macquarie University\'s&nbsp;<a href=\"http://mq.edu.au/transport/\">transportation</a>&nbsp;page for more information about getting to the Museum of Ancient Cultures including train and bus timetables, parking locations and other maps.&nbsp;</p> '),(25,'Exhibit',2,1,'Egyptian exhibit','Egyptian exhibit  '),(11,'SimplePagesPage',6,1,'AltHome','AltHome <h2>Macquarie University MUSEUM of ANCIENT CULTURES</h2>\r\n<p>&nbsp;</p>\r\n<p>[featured_carousel autoscroll=true interval=1600]</p>\r\n<p>&nbsp;</p>\r\n<div id=\"primary\">\r\n<h3>Welcome to Macquarie University Museum of Ancient Cultures!</h3>\r\n<!-- Featured Item -->\r\n<div id=\"featured-item\" class=\"featured\">\r\n<h2>Featured Item</h2>\r\n<div class=\"item record\">\r\n<h3><a href=\"/items/show/19\">little gold mummy</a></h3>\r\n<a class=\"image\" href=\"/items/show/19\"><img title=\"MU2608.png\" src=\"http://130.56.249.104/files/square_thumbnails/a33240b26b706f342f1738a76aecbc4b.jpg\" alt=\"MU2608.png\" /></a></div>\r\n</div>\r\n<!--end featured-item--> <!-- Featured Exhibit -->\r\n<div id=\"featured-exhibit\">\r\n<h2>Featured Exhibit</h2>\r\n<div class=\"exhibit record\">\r\n<h3><a href=\"/exhibits/show/e3g\">Greek Exhibit</a></h3>\r\n<a class=\"image\" href=\"/exhibits/show/e3g\"><img title=\"MU1452_thumb.png\" src=\"http://130.56.249.104/files/square_thumbnails/732f222fa376cf55765dd9574dff8902.jpg\" alt=\"MU1452_thumb.png\" /></a>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end primary -->\r\n<div id=\"secondary\"><!-- Featured Collection -->\r\n<div id=\"featured-collection\" class=\"featured\">\r\n<h2>Featured Collection</h2>\r\n<div class=\"collection record\">\r\n<h3><a href=\"/collections/show/1\">Ancient Greece Collection</a></h3>\r\n<a class=\"image\" href=\"/collections/show/1\"><img title=\"skull.jpg\" src=\"http://130.56.249.104/files/square_thumbnails/e70cfade9d5929336e34dbf3ca3793e1.jpg\" alt=\"skull.jpg\" /></a>\r\n<p class=\"collection-description\">The Ancient Greece Collection has objects ranging in date from the beginning of pre-history to early Christianity in the Byzantine era.</p>\r\n</div>\r\n</div>\r\n<!-- end featured collection -->\r\n<h2>Opening Hours</h2>\r\n<h4>9.30am - 4.30pm Monday - Friday</h4>\r\n<p>(Other times by special arrangement)</p>\r\n<h2>&nbsp;</h2>\r\n<div id=\"recent-items\">\r\n<h2>Recently Added Items</h2>\r\n<div class=\"item record\">\r\n<h3><a href=\"/items/show/21\">Ancient Egyptian beer mug</a></h3>\r\n<a class=\"image\" href=\"/items/show/21\"><img title=\"MU4078_THUMB.jpg\" src=\"http://130.56.249.104/files/square_thumbnails/450d6d0d9159693245d5b8bff3614e28.jpg\" alt=\"MU4078_THUMB.jpg\" /></a></div>\r\n<div class=\"item record\">\r\n<h3><a href=\"/items/show/20\">Greek skull</a></h3>\r\n<a class=\"image\" href=\"/items/show/20\"><img title=\"skull.jpg\" src=\"http://130.56.249.104/files/square_thumbnails/e70cfade9d5929336e34dbf3ca3793e1.jpg\" alt=\"skull.jpg\" /></a></div>\r\n<div class=\"item record\">\r\n<h3><a href=\"/items/show/19\">little gold mummy</a></h3>\r\n<a class=\"image\" href=\"/items/show/19\"><img title=\"MU2608.png\" src=\"http://130.56.249.104/files/square_thumbnails/a33240b26b706f342f1738a76aecbc4b.jpg\" alt=\"MU2608.png\" /></a></div>\r\n<p class=\"view-items-link\"><a href=\"/items\">View All Items</a></p>\r\n</div>\r\n<!--end recent-items --></div>\r\n<!-- end secondary -->\r\n<p>[featured_collections num=2]</p>\r\n<p>&nbsp;</p>\r\n<p>[featured_exhibits num=2]</p>\r\n<p>&nbsp;</p> '),(12,'SimplePagesPage',7,1,'News/Events','News/Events <h2>&nbsp;</h2> '),(14,'SimplePagesPage',9,1,'Events','Events <h2><span style=\"font-size: 1.5em;\">Events</span></h2>\r\n<p>No events today...</p> '),(13,'SimplePagesPage',8,1,'News','News <h3>Local News:</h3>\r\n<p>[items collection=3]</p>\r\n<p>&nbsp;</p>\r\n<h3>World News:&nbsp;</h3>\r\n<p>[items collection=4]</p>\r\n<p>&nbsp;</p>\r\n<h3>Developer News (last updated 8 Sep 2015)</h3>\r\n<p>Following plugins may prove useful:</p>\r\n<p>- Simple Pages</p>\r\n<p>- Exhibit Builder</p>\r\n<p>- CSV Import</p>\r\n<p>Local:&nbsp;[items num=3 collection=3 sort=\"Dublin Core,Title\" order=d]</p>\r\n<p>World:&nbsp;[items num=3 collection=4 sort=\"Dublin Core,Title\" order=d]</p> '),(15,'SimplePagesPage',10,1,'Collections','Collections  '),(16,'Collection',2,1,'Ancient Egypt Collection','Ancient Egypt Collection Ancient Egypt artefacts '),(17,'Item',2,1,'Egyptian thing','egypt Egyptian thing Egyptian thing jpg '),(18,'Item',3,1,'Greek thing','greece Greek thing Greek thing '),(19,'Item',4,1,'another Greek thing','greece another Greek thing '),(20,'Item',5,1,'gold heart','gold heart '),(21,'Item',6,1,'an old brown pot ','an old brown pot  '),(22,'Item',7,1,'an old egyptian bottle','an old egyptian bottle '),(23,'Item',8,1,'partial gold mask','partial gold mask '),(24,'Item',9,1,'old gold amulet','old gold amulet '),(27,'Exhibit',3,1,'Greek Exhibit','Greek Exhibit  '),(28,'ExhibitPage',4,1,'Greek Exhibit p1','    Greek Exhibit p1 '),(36,'Item',15,0,'amnh1','carousel amnh1 '),(29,'Collection',3,0,'LOCAL NEWS','LOCAL NEWS '),(30,'Collection',4,0,'WORLD NEWS','WORLD NEWS '),(31,'Item',10,0,'Local News 2015/09/22','localnews Local News 2015/09/22 '),(32,'Item',11,0,'World News 2015/09/23','worldnews World News 2015/09/23 '),(33,'Item',12,0,'Local News 2015/09/21','localnews Local News 2015/09/21 text for 21/9/2015 news '),(37,'Item',16,0,'amnh2','carousel amnh2 '),(34,'Item',13,0,'World News 2015/09/22','worldnews World News 2015/09/22 '),(35,'Item',14,0,'Local News 2015/09/23','localnews Local News 2015/09/23 '),(38,'Item',17,0,'amnh3','carousel amnh3 '),(39,'Item',18,0,'amnh4','carousel amnh4 '),(40,'Item',19,1,'little gold mummy','carousel little gold mummy '),(41,'Item',20,1,'Greek skull','Greek skull '),(42,'Item',21,1,'Ancient Egyptian beer mug','Ancient Egyptian beer mug ');
