INSERT INTO `omeka_simple_pages_pages` VALUES (1,1,1,1,'About MAC','about','<p>This Museum is an Ancient History/ Archaeology museum designed to support the teaching of undergraduate and postgraduate programs on offer at Macquarie University within the department of Ancient History. It also promotes Ancient History and Archaeology to the primary and secondary schools of NSW and the ACT as well as to the broader general community.</p>\r\n<p>The Museum of Ancient Cultures (MAC) was conceived to show elements of everyday life in the ancient world as the guiding principle to its on-going development. In this way modern minds can contemplate the lives and thoughts of past people and come to appreciate the work they have done before us.</p>\r\n<p>This site is designed to show information about activities and events associated with the Museum, about artefacts (and new additions) to our collections as well as about the collections themselves, about the programs we offer and the resources we have developed, including teaching resources. There are also links to organisations and museums associated with us.</p>\r\n<p>Through periodic updating, this site will also share our news with users. We hope you will enjoy the site and be in touch with us when you have suggestions or wish to make enquiries.</p>\r\n<p>[featured_collections num=1]</p>\r\n<p>[items num=1 sort=random]</p>\r\n<p>[featured_exhibits num=1]</p>\r\n<p>[carousel tags=carousel autoscroll=true showtitles=true]</p>','2015-09-27 09:10:07','2015-09-05 12:50:13',0,0,'',1),(2,1,1,1,'Education','education','Education offerings include:\r\n- AHIS111\r\n- AHIS222\r\n- AHIS333\r\n- schools\r\n','2015-09-08 16:40:17','2015-09-05 14:07:17',0,0,'',0),(3,1,1,1,'Programs','programs','Programs:\r\n- Education\r\n- Volunteers','2015-09-08 16:40:44','2015-09-05 14:16:09',0,0,'',0),(4,1,1,1,'Contact Us','contact','<h2>Location</h2>\r\n<p><img src=\"http://www.mac.mq.edu.au/custom/files/media/mac-map_v2_thumbnail.jpg\" alt=\"MAC - Map Thumbnail\" /></p>\r\n<p>Building X5B Level 3<br />Ph: (02) 9850 9263<br />FX: (02) 9850 9267<br />E-mail:&nbsp;<a href=\"mailto:karl.vandyke@mq.edu.au\">karl.vandyke@mq.edu.au</a></p>\r\n<h2>Opening Hours</h2>\r\n<p>9.30am - 4.30pm Monday - Friday</p>\r\n<p>Other times by special arrangement</p>','2015-09-23 07:31:13','2015-09-05 15:05:25',2,0,'',1),(5,1,1,1,'Your visit','visit','<h2>Opening Hours</h2>\r\n<p>9.30am - 4.30pm Monday - Friday (Other times by special arrangement)</p>\r\n<p>Please note that the Museum is usually open for major University events such as Information and Open Days, as well as major Ancient History events such as the annual Ancient History Teachers\' Conference and student Study Days.</p>\r\n<h2>Map</h2>\r\n<p><img src=\"http://www.mac.mq.edu.au/custom/files/media/mac-map_v2_thumbnail.jpg\" alt=\"MAC - Map Thumbnail\" /><a href=\"http://www.mac.mq.edu.au/custom/files/media/mac-map_v2.jpg\" target=\"_blank\"><br />View the full map</a></p>\r\n<h2>Transportation</h2>\r\n<p>Visit Macquarie University\'s&nbsp;<a href=\"http://mq.edu.au/transport/\">transportation</a>&nbsp;page for more information about getting to the Museum of Ancient Cultures including train and bus timetables, parking locations and other maps.&nbsp;</p>','2015-09-05 18:30:45','2015-09-05 15:08:32',1,6,'',1),(6,1,1,1,'AltHome','althome','<h2>Macquarie University MUSEUM of ANCIENT CULTURES</h2>\r\n<p>&nbsp;</p>\r\n<p>[featured_carousel autoscroll=true interval=1600]</p>\r\n<p>&nbsp;</p>\r\n<div id=\"primary\">\r\n<h3>Welcome to Macquarie University Museum of Ancient Cultures!</h3>\r\n<!-- Featured Item -->\r\n<div id=\"featured-item\" class=\"featured\">\r\n<h2>Featured Item</h2>\r\n<div class=\"item record\">\r\n<h3><a href=\"/items/show/19\">little gold mummy</a></h3>\r\n<a class=\"image\" href=\"/items/show/19\"><img title=\"MU2608.png\" src=\"http://130.56.249.104/files/square_thumbnails/a33240b26b706f342f1738a76aecbc4b.jpg\" alt=\"MU2608.png\" /></a></div>\r\n</div>\r\n<!--end featured-item--> <!-- Featured Exhibit -->\r\n<div id=\"featured-exhibit\">\r\n<h2>Featured Exhibit</h2>\r\n<div class=\"exhibit record\">\r\n<h3><a href=\"/exhibits/show/e3g\">Greek Exhibit</a></h3>\r\n<a class=\"image\" href=\"/exhibits/show/e3g\"><img title=\"MU1452_thumb.png\" src=\"http://130.56.249.104/files/square_thumbnails/732f222fa376cf55765dd9574dff8902.jpg\" alt=\"MU1452_thumb.png\" /></a>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- end primary -->\r\n<div id=\"secondary\"><!-- Featured Collection -->\r\n<div id=\"featured-collection\" class=\"featured\">\r\n<h2>Featured Collection</h2>\r\n<div class=\"collection record\">\r\n<h3><a href=\"/collections/show/1\">Ancient Greece Collection</a></h3>\r\n<a class=\"image\" href=\"/collections/show/1\"><img title=\"skull.jpg\" src=\"http://130.56.249.104/files/square_thumbnails/e70cfade9d5929336e34dbf3ca3793e1.jpg\" alt=\"skull.jpg\" /></a>\r\n<p class=\"collection-description\">The Ancient Greece Collection has objects ranging in date from the beginning of pre-history to early Christianity in the Byzantine era.</p>\r\n</div>\r\n</div>\r\n<!-- end featured collection -->\r\n<h2>Opening Hours</h2>\r\n<h4>9.30am - 4.30pm Monday - Friday</h4>\r\n<p>(Other times by special arrangement)</p>\r\n<h2>&nbsp;</h2>\r\n<div id=\"recent-items\">\r\n<h2>Recently Added Items</h2>\r\n<div class=\"item record\">\r\n<h3><a href=\"/items/show/21\">Ancient Egyptian beer mug</a></h3>\r\n<a class=\"image\" href=\"/items/show/21\"><img title=\"MU4078_THUMB.jpg\" src=\"http://130.56.249.104/files/square_thumbnails/450d6d0d9159693245d5b8bff3614e28.jpg\" alt=\"MU4078_THUMB.jpg\" /></a></div>\r\n<div class=\"item record\">\r\n<h3><a href=\"/items/show/20\">Greek skull</a></h3>\r\n<a class=\"image\" href=\"/items/show/20\"><img title=\"skull.jpg\" src=\"http://130.56.249.104/files/square_thumbnails/e70cfade9d5929336e34dbf3ca3793e1.jpg\" alt=\"skull.jpg\" /></a></div>\r\n<div class=\"item record\">\r\n<h3><a href=\"/items/show/19\">little gold mummy</a></h3>\r\n<a class=\"image\" href=\"/items/show/19\"><img title=\"MU2608.png\" src=\"http://130.56.249.104/files/square_thumbnails/a33240b26b706f342f1738a76aecbc4b.jpg\" alt=\"MU2608.png\" /></a></div>\r\n<p class=\"view-items-link\"><a href=\"/items\">View All Items</a></p>\r\n</div>\r\n<!--end recent-items --></div>\r\n<!-- end secondary -->\r\n<p>[featured_collections num=2]</p>\r\n<p>&nbsp;</p>\r\n<p>[featured_exhibits num=2]</p>\r\n<p>&nbsp;</p>','2015-09-27 10:34:19','2015-09-05 18:28:10',0,0,'',1),(7,1,1,1,'News/Events','news_events','<h2>&nbsp;</h2>','2015-09-08 16:06:44','2015-09-08 15:28:43',0,0,'',1),(8,1,1,1,'News','news','<h3>Local News:</h3>\r\n<p>[items collection=3]</p>\r\n<p>&nbsp;</p>\r\n<h3>World News:&nbsp;</h3>\r\n<p>[items collection=4]</p>\r\n<p>&nbsp;</p>\r\n<h3>Developer News (last updated 8 Sep 2015)</h3>\r\n<p>Following plugins may prove useful:</p>\r\n<p>- Simple Pages</p>\r\n<p>- Exhibit Builder</p>\r\n<p>- CSV Import</p>\r\n<p>Local:&nbsp;[items num=3 collection=3 sort=\"Dublin Core,Title\" order=d]</p>\r\n<p>World:&nbsp;[items num=3 collection=4 sort=\"Dublin Core,Title\" order=d]</p>','2015-09-23 12:24:31','2015-09-08 16:00:45',0,7,'',1),(9,1,1,1,'Events','events','<h2><span style=\"font-size: 1.5em;\">Events</span></h2>\r\n<p>No events today...</p>','2015-09-08 16:12:46','2015-09-08 16:08:24',0,7,'',1),(10,1,1,1,'Collections','collections','','2015-09-08 16:13:24','2015-09-08 16:09:21',0,0,'',0);
